import { Typography, Box } from "@mui/material";

const Nav = (mediaQuery) => {

    return (
        <Box
            width="100%"
            display="flex"
            border="1px solid black"
        >
            <img src={`${process.env.PUBLIC_URL}/img/logo.png`} alt="" width="30%" height="auto"/>
            <Typography variant="h1">Nav</Typography>
        </Box>
    );
}

export default Nav;
